import React from 'react';
import { Wrapper, Label, StyledInput } from './styles';

export interface IInput {
  label: string;
  placeholder?: string;
  width?: string;
}

const Input: React.FC<IInput> =
  ({ label,
     placeholder,
     width }) => {
  return (
    <Wrapper>
      <Label>{label}</Label>
      <StyledInput placeholder={placeholder} />
    </Wrapper>
  )
}

export default Input;
